import React from "react";
import 'bulma/css/bulma.min.css'
import '../'

export default function App() {
  return (
    <footer class="footer">
      <div class="content has-text-centered">
        <a href="https://www.linkedin.com/in/nyatyus/"><img src="../../public/linkedin.png" alt="LinkedIn logo"></img></a>
      </div>
    </footer>
  );
}
